  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Long Lake NWR
  outlines Refuge accomplishments from May through August of 1942. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, and fish- is also covered. The Refuge
  development and maintenance section discusses physical developments. Resource management
  is outlined; topics include grazing and haying. The public relations section of
  the report describes Refuge visitors. N-R forms and photographs are attached.\",\n\t\"owner_org\":
